import React from "react";

const Datos = () => {
  return (
    <aside className='informacion-personal'>
      <h2>Información Personal</h2>
      <ul>
        <li>
          <strong>Nombre:</strong> Uriel
        </li>
        <li>
          <strong>Profesión:</strong> Sistemas
        </li>
        <li>
          <strong>Saldo actual en cuenta:</strong> S/. 100000000000
        </li>
        <li>
          <strong>Número de cuenta:</strong> 4557-3127-6213-6323
        </li>
        <li>
          <strong>Cantidad de tarjetas:</strong> 3
        </li>
      </ul>
    </aside>
  );
};

export default Datos;
